import React,{Component} from 'react';

function TopNavRightIcon(props) {
    
    return (
        <ul>
            <li><select id="basic" className="selectpicker show-tick form-control" placeholder="تسجيل الدخول" title="register"><option>{props.option}</option>
            </select>
            <i className="fas fa-users"></i>
            </li>
            <li><a href={props.href} title={props.title} id={props.id}>{props.media}<i className={props.className}></i></a></li>
        </ul>
    );
};

export default TopNavRightIcon;
